for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==0){
a0_fr[ocgName[1]]=ocg[i];
}
}
a0_playsRight=true;
a0_isPaused=false;
a0_playing=false;
a0_fps=30;
a0_spd=1;
