a0_fps=(f==0?1e-6:f);
if(a0_playing){
if(a0_playsRight){a0_playRight();}else{a0_playLeft();}
}
};
a0_seekFrame=function(f){
if(f>0||f<0){return -1;}
a0_idx=f;
a0_fr[a0_on].setAttribute('visibility','hidden');
a0_fr[f].setAttribute('visibility','visible');
a0_on=f;
return 0;
};
a0_stopFirst=function(){a0_pause(true);a0_seekFrame(0);};
a0_stopLast=function(){a0_pause(true);a0_seekFrame(0);};
a0_gotoNext=function(){
if(a0_seekFrame(a0_idx+1)<0){
a0_stopLast();
return;
}
};
a0_gotoPrev=function(){
if(a0_seekFrame(a0_idx-1)<0){
a0_stopFirst();
return;
}
};
a0_pause=function(stop){
try{clearInterval(a0_int);}catch(e){}
a0_playing=false;
a0_isPaused=!stop;
};
a0_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a0_gotoNext()',1000/a0_fps/a0_spd);}catch(e){}
try{clearInterval(a0_int);}catch(e){}
a0_int=tmp_int;
a0_playsRight=true;
a0_playing=true;
a0_isPaused=false;
};
a0_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a0_gotoPrev()',1000/a0_fps/a0_spd);}catch(e){}
try{clearInterval(a0_int);}catch(e){}
a0_int=tmp_int;
a0_playsRight=false;
a0_playing=true;
a0_isPaused=false;
};
a0_stepBwd=function(){if(!a0_playing){a0_seekFrame(a0_idx-1);a0_isPaused=true;}};
a0_stepFwd=function(){if(!a0_playing){a0_seekFrame(a0_idx+1);a0_isPaused=true;}};
a0_playBwd=function(){if(a0_idx==0||!a0_isPaused){a0_stopLast();}a0_playLeft();};
a0_playFwd=function(){if(a0_idx==0||!a0_isPaused){a0_stopFirst();}a0_playRight();};
if(!anim){anim=new Array();}
if(typeof anim['my_anim1']==='undefined'){
anim['my_anim1']={
playBwd:a0_playBwd,
playFwd:a0_playFwd,
pause:a0_pause,
get isPlaying(){return a0_playing;},
get fps(){return a0_fps;},
set fps(f){
if(f<0||isNaN(f)){throw new RangeError('Frame_rate_not_in_allowed_range');}else{a0_setFps(f);}},
get speed(){return a0_spd;},
set speed(s){
if(s<=0||isNaN(s)){
throw new RangeError('Speed_factor_not_in_allowed_range');
}else{
a0_spd=s;
a0_setFps(a0_fps);
}
},
get dt(){return 1000/a0_fps/a0_spd;},
get playsFwd(){return a0_playsRight;},
get numFrames(){return 1;},
get frameNum(){return a0_idx;},
set frameNum(ff){
var f=Math.floor(ff);
if(f<0||f>0||isNaN(f)){throw new RangeError('Frame_number_not_in_allowed_range');}
if(a0_playing){
a0_pause();a0_seekFrame(f);
if(a0_playsRight){a0_playRight();}else{a0_playLeft();}
}else{if(a0_seekFrame(f)>-1)a0_isPaused=true;}
},
stopFirst:a0_stopFirst,
stopLast:a0_stopLast
};
}
a0_seekFrame(0);
}onvisible();
}
function onvisible(){
}
function onhidden(){
if(a0_playing){a0_pause(true);}
if(!a0_isPaused)a0_playsRight=true;
if(!a0_isPaused&&a0_idx!=0)a0_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
})();

